import React from 'react';
import { FooterContainer, FooterCopyrightContainer, FooterCopyrightText } from './footer.styles';
import { BannerText, HeaderLineBreak } from '../banner/banner.styles';
import MailchimpSubscribeForm from '../mailchimp-form/mailchimp-subscribe-form.component';
import CustomButton from '../custom-button/custom-button.component';
const Footer = () => {
    var d = new Date();
    var n = d.getFullYear();
    return (

        <FooterContainer>
        <BannerText>
        Subscribe for rates,<HeaderLineBreak />early notice on new releases,<HeaderLineBreak />And Special Deals
        <div id="mc_embed_signup">
          <MailchimpSubscribeForm />
        </div>
        </BannerText>
            <center><FooterCopyrightContainer><FooterCopyrightText>&#169; {n}, Dale Street Studio, LLC</FooterCopyrightText></FooterCopyrightContainer></center>
        </FooterContainer>
    );
};

export default Footer;
